// StudentFeedbackForm.js
import React, { useState } from 'react';
import './tFeedbackForm.css';

const StudentFeedbackForm = ({ onSubmit }) => {
  const [studentName, setStudentName] = useState('');
  const [feedback, setFeedback] = useState('');

  const handleStudentNameChange = (e) => {
    setStudentName(e.target.value);
  };

  const handleFeedbackChange = (e) => {
    setFeedback(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit({ studentName, feedback });
    setStudentName('');
    setFeedback('');
    alert('Phản hồi của sinh viên đã được gửi thành công!');
  };

  return (
    <div className="feedback-container">
      <h2>Form Phản Hồi của Sinh Viên</h2>
      <form onSubmit={handleSubmit} className="FeedbackForm">
        <div className="form-group">
          <label htmlFor="studentName">Họ và Tên Sinh Viên:</label>
          <input
            type="text"
            id="studentName"
            value={studentName}
            onChange={handleStudentNameChange}
            placeholder="Nhập tên của bạn"
          />
        </div>
        <div className="form-group">
          <label htmlFor="feedback">Phản Hồi:</label>
          <textarea
            id="feedback"
            value={feedback}
            onChange={handleFeedbackChange}
            placeholder="Nhập phản hồi của bạn"
          />
        </div>
        <button type="submit">Gửi Phản Hồi</button>
      </form>
    </div>
  );
};

export default StudentFeedbackForm;
